import React from 'react'
import styles from './Modal.module.css'


const onSubmitHandler = (e) => {
    e.preventDefault();
}

const Adduser = ({ show }) => {
    return (
        <div>
            <form className={styles.control} onSubmit={onSubmitHandler}>
                
                <label htmlFor='name'>NAME</label>
                <input type='text' placeholder='set a name '></input>
                <label htmlFor='name'>Age</label>
                <input type='text' placeholder='set a age '></input>
                <label htmlFor='name'>Address</label>
                <input type='text' placeholder='set a Address '></input>
                <label htmlFor='name'>Phone</label>
                <input type='text' placeholder='set a Phone '></input>

            </form>
        </div>

    )
}

export default Adduser
